import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Home from './component/Home'
import { Nav, Navbar } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <header className="head">
            <Navbar className="color-nav" expand="lg">
              <Link to="/">ENELPİ</Link>
              <Navbar.Toggle aria-controls="basic-navbar-nav" />
              <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="header_user">
                  <Link className="home" to="/">HOME</Link>
                  <Link className="home" to="bert">BERT</Link>
                  <Link className="home" to="electra">ELECTRA</Link>
                </Nav>
              </Navbar.Collapse>
            </Navbar>
          </header>
          <Switch>

            <Route path="/"> <Main/> </Route>

            <Route path="/signup"> <UsersSignup /></Route>

            <Route path="/login"> <UsersLogin /> </Route>

            <Route path="/contact"> <UsersContact /> </Route>

            <Route path="/"> <Main /> </Route>

          </Switch>
        </div>
      </Router>
    </div>
  );
}

function Main() {
  return <Home />
}

function BertModel() {
  return <Bert />
}

function Electra() {
  return <Signup />
}

export default App;
